oxy_webhelp_navlinks = {"account_locking-d23139e10074":{"topics":[{"title":"Locking user accounts administratively","shortdesc":"<p class=\"shortdesc\">As a user with global administrator or <span class=\"ph\">RSC<\/span> account owner privileges,         lock a local user account or an SSO user account to block the user access         temporarily.<\/p>","href":"saas\/common\/locking_user_accounts_administratively.html","attributes":{"data-id":"locking_user_accounts_administratively"},"menu":{"hasChildren":false},"tocID":"locking_user_accounts_administratively-d23139e10088","topics":[]},{"title":"Brute force lock","shortdesc":"<p class=\"shortdesc\">A brute force lock is a type of user account locking that prevents brute force         attacks. A user account is automatically locked after a configurable number of consecutive         unsuccessful login attempts.<\/p>","href":"saas\/common\/brute_force_lock.html","attributes":{"data-id":"brute_force_lock"},"menu":{"hasChildren":false},"tocID":"brute_force_lock-d23139e10102","topics":[]},{"title":"Inactive account lock","shortdesc":"<p class=\"shortdesc\">An inactive lock automatically protects local user accounts by locking them after a         configured duration of inactivity. This feature stops unauthorized access to dormant or         forgotten accounts.<\/p>","href":"saas\/common\/inactive_account_lock.html","attributes":{"data-id":"inactive_account_lock"},"menu":{"hasChildren":false},"tocID":"inactive_account_lock-d23139e10113","topics":[]}]}};